import React, { useState } from 'react';
import './UpdateProfile.css';

function DoctorUpdateProfile() {
    const [doctorInfo, setDoctorInfo] = useState({
        fullname: '',
        idCard: '',
        gender: '',
        dateOfBirth: '',
        phone: '',
        email: '',
        address: '',
        qualification: '',
        experience: '',
        password: '',
    });

    const handleChange = (event) => {
        const { name, value } = event.target;
        setDoctorInfo((prevInfo) => ({
            ...prevInfo,
            [name]: value,
        }));
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        // TODO: Handle form submission logic
    };

    return (
        <div className="form1">
            <form onSubmit={handleSubmit} className="form-container">
                <h2>Cập nhật thông tin cá nhân</h2>
                <div className="form-group">
                    <label className="form-label">Họ tên:</label>
                    <input
                        type="text"
                        name="fullname"
                        value={doctorInfo.fullname}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">CMND/CCCD:</label>
                    <input
                        type="text"
                        name="idCard"
                        value={doctorInfo.idCard}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Giới tính:</label>
                    <input
                        type="text"
                        name="gender"
                        value={doctorInfo.gender}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Ngày tháng năm sinh:</label>
                    <input
                        type="text"
                        name="dateOfBirth"
                        value={doctorInfo.dateOfBirth}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Email:</label>
                    <input
                        type="text"
                        name="email"
                        value={doctorInfo.email}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Số điện thoại:</label>
                    <input
                        type="text"
                        name="phone"
                        value={doctorInfo.phone}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Địa chỉ:</label>
                    <input
                        type="text"
                        name="address"
                        value={doctorInfo.address}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Bằng cấp:</label>
                    <input
                        type="text"
                        name="qualification"
                        value={doctorInfo.qualification}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Kinh nghiệm làm việc:</label>
                    <input
                        type="text"
                        name="experience"
                        value={doctorInfo.experience}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <div className="form-group">
                    <label className="form-label">Mật khẩu:</label>
                    <input
                        type="password"
                        name="password"
                        value={doctorInfo.password}
                        onChange={handleChange}
                        className="form-input"
                    />
                </div>
                <button type="submit" className="submit-button">
                    Cập nhật
                </button>
            </form>
        </div>
    );
}

export default DoctorUpdateProfile;
